;; @@
(defn plot-diameter-dist [[id author]]
  (let [dat {:values (temporal-diameter id t0 tmax :distribution)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :values]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 5 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "Hours"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Temporal radius distribution of " (element-name author))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;merciful-ocean/plot-diameter-dist</span>","value":"#'merciful-ocean/plot-diameter-dist"}
;; <=

;; @@
#_(for [b broadcasters]
  (plot-diameter-dist b))
;; @@

;; **
;;; # Evolution
;; **

;; @@
(let [curr (->>   broadcasters
                  (map (fn [[id author]] (map :mean (temporal-diameter id t0 tmax :evolution))))
                  (apply map vector)
                  (map stats/mean)
                  )
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#222222"}]
         [:xlab "Day"]
         [:ylab "Temporal diameter in hours"]
         [:theme_bw]
         [:ggtitle "Average diameter evolution"])]
      {:width 5 :height 5}))
