;; @@
(defn plot-diameter-evolution [[id author]]
(let [curr (map :mean (temporal-diameter id t0 tmax :evolution))
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#999999"}]
         [:xlab "Day"]
         [:ylab "Hours"]
         [:theme_bw]
         [:ggtitle (str (element-name author) " avg diameter evolution")])]
      {:width 5 :height 5})))
;; @@
